Playmobil Parçalı Set Back To The Future Delorean 70317
17 yaşında olmak kolay değil. Okul bunaltıcıdır, ebeveynler sinir bozucudur ve kaybeden olma riski vardır. Marty McFly'in hayatındaki tek umut ışığı, çılgın profesör arkadaşı Doktor Brown'dur. Doktor, DeLorean'ı bir zaman makinesine dönüştürdü ve Marty bilmeden bir spor otomobilde zaman içinde seyahat ediyor ve 50'lerin ortalarına iniyor. Burada genç ebeveynleriyle tanışır ve sadece geleceğini karıştırmakla kalmaz, aynı zamanda tüm uzay-zaman sürekliliğini riske de atıyor. Büyük soru da şu: Geleceğe nasıl dönecek? İçeri gir ve DeLorean'da Marty ile zaman içinde seyahat et ve harika maceralar yaşa. Oyun seti 80'lerin kült filmi üçlemesi "" Geleceğe Dönüş "ün tanınmış karakterleri Marty McFly ve Doktor Brown'u içeriyor. Efsanevi DeLorean DMC-12 elbette bir plütonyum kabı, akı dengeleyici ve gösterge tablosunda zaman yolculuğu ekranı ile donatılmıştır. Uçuş moduna geçmek için dört tekerleğin hepsi de 90 derece katlanabilir.

