Batman™: The Animated Series™ figürleri – Çocuklara hitap eden bu Batman oyuncağı, inşa edilebilen bir Batmobile™ ile Batman, Harley Quinn™ ve Mr. Freeze™ minifigürleri içerir;
LEGO® Batman™ araç seti – İtmeli Batmobile™ arabanın kaputunda çıkarılabilir mermi fırlatıcılar, açılabilen bir kokpit, kontrol paneli ve araba giderken dönen bir egzoz alevi bulunur;
Döndürülebilir sergileme standı – Döndürülebilir stant ve açıklama levhası, ünlü LEGO® Batman™ Batmobile™’in 360 derecelik bir görünümünü sunar;
LEGO® Batman™ araba hediyesi – Bu oyun ve sergileme modeli, hem çocuklar için aksiyon dolu bir hediye, hem de yaşı büyük Batman™ tutkunları için nostaljik bir hediyedir;
3 boyutlu yapım talimatları – Çocuklar, sürükleyici bir yapım deneyimi için modelleri 3 boyutlu yakınlaştırıp döndürmelerine, setleri kaydetmelerine ve ilerlemeyi takip etmelerine olanak tanıyan dijital araçlarıyla LEGO® Builder uygulamasını indirebilir;
LEGO® DC serisi – Geniş LEGO® DC yapım oyuncakları koleksiyonu, sınırsız yapım ve oyun olasılığı sunacak şekilde tasarlanmıştır;
